import ReturnPhoneSetting from './Phone';
import ReturnPinSetting from './Pin';

// View Profile view 
export default function ReturnProFil() {
 return (
  <div className='wrp-profil-money'>
   <REturnArroW />
   <ReturnSubJect />
   <ReturnAvataR />
   <ReturnName />
   <ReturnPhoneSetting />
   <ReturnPinSetting />
  </div>
 );
}
